('Ship_VY', 1, 'D1(Quad)', 'Superior Oceanview Stateroom With Balcony (occ 4', '高級陽台房 (4人)', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, private balcony, sitting area and a private bathroom. Rates vary from deck to deck. (179 sq. ft., balcony 52 sq. ft.)</p>', '<p>兩張雙人床（可改成大床）、私人陽台、起居間（有些帶沙發床）、私人浴室。各層甲板的房費不同。 (179平方尺、陽台52平方尺)</p>', 4, 'upload/image/Ocean View with Balcony D1 E1 D2 D3 E2 E3.jpg', 1436943506, 1470397409),
('Ship_VY', 2, 'D2/D3', 'Superior Oceanview Stateroom With Balcony', '高級陽台房', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, private balcony, sitting area and a private bathroom. Rates vary from deck to deck. (179 sq. ft., balcony 52 sq. ft.)</p>', '<p>兩張單人床（可改成大床）、私人陽台、起居間（有些帶沙發床）、私人浴室。各層甲板的房費不同。 (179平方尺、陽台52平方尺)</p>', 2, 'upload/image/Ocean View with Balcony D1 E1 D2 D3 E2 E3-527.jpg', 1436943732, 1454570092),
('Ship_VY', 3, 'E1(Triple)', 'Deluxe Oceanview Stateroom with Balcony (occ 3)', '標準陽台房 (3人)', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, private balcony, sitting area with sofa, and a private bathroom. Rates vary from deck to deck. (164 sq. ft., balcony 51 sq. ft.)</p>', '<p>兩張雙人床（可改成大床）、私人陽台、起居間（有些帶沙發床）、私人浴室。各層甲板的房費不同。 (164平方尺、陽台51平方尺)</p>', 3, 'upload/image/Ocean View with Balcony D1 E1 D2 D3 E2 E3-353.jpg', 1436943584, 1444896904),
('Ship_VY', 4, 'E2/E3', 'Deluxe Oceanview Stateroom with Balcony', '標準陽台房', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, private balcony, sitting area with sofa, and a private bathroom. Rates vary from deck to deck. (164 sq. ft., balcony 51 sq. ft.)&nbsp;</p>', '<p>兩張雙人床（可改成大床）、私人陽台、起居間（有些帶沙發床）、私人浴室。各層甲板的房費不同。 (164平方尺、陽台51平方尺)</p>', 2, 'upload/image/Ocean View with Balcony D1 E1 D2 D3 E2 E3-648.jpg', 1436945081, 1440660257),
('Ship_VY', 5, 'F', 'Large Oceanview Stateroom (Cat. F)', '大海景房 (Cat. F)', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, sitting area with sofa, vanity area and a private bathroom. (178 sq. ft.)</p>', '<p>兩張單人床（可改成大床）、起居間（有些帶沙發床）、私人浴室和洗臉盆。 （178平方尺）</p>', 2, 'upload/image/Oceanview FO F H I.jpg', 1436945520, 1469502967),
('Ship_VY', 6, 'FO', 'Family Oceanview Stateroom', '家庭海景房', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, additional bunk beds in separate area, separate sitting area with sofa bed, and a private bathroom with shower. (262 sq. ft.)&nbsp;</p>', '<p>兩張雙人床（可改成大床）、起居間（有些帶沙發床）、私人浴室和洗臉盆（帶淋浴）。 （262平方尺）</p>', 4, 'upload/image/Oceanview FO F H I-496.jpg', 1436945448, 1436945532),
('Ship_VY', 7, 'FS', 'Family Suite', '皇家陽台家庭套房 ', '<p>Two bedrooms with two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long (one room with third and fourth Pullman beds), two bathrooms (one with shower, one with bathtub), living area with double sofa bed, private balcony and concierge service. <br />(561 sq. ft., balcony 246 sq. ft)</p>', '<p>兩張雙人床（可改成大床）、私人陽台、起居間（有些帶沙發床）、私人浴室。 (561平方尺、陽台246平方尺)&nbsp;</p>', 6, 'upload/image/013 Grand Suite_resize.jpg', 1436782278, 1454462957),
('Ship_VY', 8, 'GS', 'Grand Suite', '豪華陽台套房', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, private balcony, sitting area (some with sofa bed) and concierge service. (349 sq. ft., balcony 100 sq. ft.)</p>', '<p>兩張單人床，可改成大床、私人陽台、起居室帶沙發床、禮賓服務。 （349平方尺，陽台100平方尺）</p>', 4, 'upload/image/020 Grande Suite_resize.jpg', 1436944873, 1454570129),
('Ship_VY', 9, 'H(Triple)', 'Oceanview Stateroom (occ3)', '海景房 (3人)', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, sitting area , vanity area, and a private bathroom. (160 sq. ft.)</p>', '<p>兩張雙人床（可改成大床）、起居間（有些帶沙發床）、私人浴室和洗臉盆。 （160平方尺）</p>', 3, 'upload/image/Oceanview FO F H I-370.jpg', 1436945635, 1440405024),
('Ship_VY', 10, 'I', 'Oceanview Stateroom (Cat. I)', '海景房 (Cat. I)', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, sitting area , vanity area, and a private bathroom. (160 sq. ft.)</p>', '<p>兩張雙人床（可改成大床）、起居間（有些帶沙發床）、私人浴室和洗臉盆。 （160平方尺）</p>', 2, 'upload/image/Oceanview FO F H I-157.jpg', 1436945673, 1469502991),
('Ship_VY', 11, 'J', 'Interior Stateroom with Virtual Balcony', '虛擬陽台房', '<p>Offer the innovative design concept that brings virtual balconies to interior staterooms offering expansive real-time views of the ocean and exciting destinations.</p>', '<p>創新的設計概念，將虛擬的陽台帶到客艙內，為客人展現叫人興奮的旅程及海洋實時影像。</p>', 2, 'upload/image/Interior with Virtual Balcony J.jpg', 1436945751, 1439350787),
('Ship_VY', 12, 'JS', 'Junior Suite', '標準陽台套房', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, private balcony, sitting area (some with sofa bed) and private batroom. (264 sq. ft., balcony 75 sq. ft.)&nbsp;</p>', '<p>兩張單人床（可改成大床）、私人陽台、起居間（有些帶沙發床）、私人浴室。 (264平方尺、陽台75平方尺)</p>', 4, 'upload/image/GS7_0849.jpg', 1436943389, 1454570146),
('Ship_VY', 14, 'K/L', 'Interior Stateroom (occ 4)', ' 內艙房 (4人)', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, sitting area, vanity area and a private bathroom. (150 sq. ft.)</p>', '<p>兩張雙人床（可改成大床）、起居間（有些帶沙發床）、私人浴室和洗臉盆。 (150平方尺)</p>', 4, 'upload/image/Interior J K L M N Q.jpg', 1436945787, 1440404882),
('Ship_VY', 15, 'M', 'Interior Stateroom (Cat.M)', ' 內艙房 (Cat.M)', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, sitting area, vanity area and a private bathroom. (150 sq. ft.)</p>', '<p>兩張雙人床（可改成大床）、起居間（有些帶沙發床）、私人浴室和洗臉盆。 (150平方尺)</p>', 2, 'upload/image/Interior J K L M N Q-34.jpg', 1436946216, 1469502928),
('Ship_VY', 16, 'N/Q', 'Interior Stateroom (Cat. N/Q)', ' 內艙房 (Cat. N/Q)', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, sitting area, vanity area and a private bathroom. (150 sq. ft.)</p>', '<p>兩張單人床（可改成大床）、起居間（有些帶沙發床）、私人浴室和洗臉盆。 (150平方尺)</p>', 2, 'upload/image/Interior J K L M N Q-62.jpg', 1436946256, 1469502944),
('Ship_VY', 17, 'OS', 'Owner Suite', '主人陽台套房 ', '<p>Queen-size bed, private balcony, separate living area with queen-size sofa bed, private bathroom with bathtub, separate shower and bidet, and concierge service. <br />(559 sq. ft., balcony 90 sq. ft.) </p>', '<p>大床、私人陽台、起居室帶大沙發床、私人浴室（帶浴缸）、單獨的淋浴和浴盆、禮賓服務。 <br />（559平方尺，陽台90平方尺）</p>', 4, 'upload/image/009 Owner''s Suite.jpg', 1436781811, 1436781905),
('Ship_VY', 18, 'P1', 'Panoramic Oceanview Stateroom *NEW*', '高級環迴海景房', '<p>Two lower twin beds that convert to Royal King, measuring 72.5 inches wide by 82 inches long. Double sofa bed. Vanity with sitting area. Private bathroom with shower. Floor to ceiling wrap around panoramic window, 76 inches high by 253 inches wide. (283 sq. ft.)&nbsp;</p>', '<p>兩張雙人床（可改成大床）、雙人沙發床、起居間、私人浴室（帶淋浴）和洗臉盆。設有高76&rdquo;x 闊253&rdquo; 的環迴落地觀景窗。 (283平方尺)&nbsp;</p>', 4, 'upload/image/Panoramic Ocean View P1 P2-269.jpg', 1436945337, 0),
('Ship_VY', 19, 'P2', 'Panoramic Oceanview Stateroom *NEW*', '環迴海景房', '<p>Two lower twin beds convert to Royal King, measuring 72.5 inches wide by 82 inches long. Double sofa bed for quad staterooms. Vanity with sitting area, Private bathroom with shower. Floor to Ceiling wrap around panoramic window, 76 inches high by 103 inches wide. (Staterooms size varies from 191 to 215 sq. ft.)&nbsp;</p>', '<p>兩張雙人床（可改成大床）、四人房帶雙人沙發床、起居間、私人浴室（帶淋浴）和洗臉盆。設有高76&rdquo;x 闊103&rdquo; 的環迴落地觀景窗。 (191-215平方尺)&nbsp;</p>', 4, 'upload/image/Panoramic Ocean View P1 P2-354.jpg', 1436945375, 0),
('Ship_VY', 20, 'PF', 'Panoramic Oceanview Family Stateroom *NEW*', '環迴家庭海景房', '<p>Two lower twin beds that convert to Royal King, measuring 72.5 inches wide by 82 inches long. Curtained section with bunk beds. Living area with double sofa bed, vanity and sitting area. One and a half baths with shower. Floor to ceiling wrap around panoramic windows, 76 inches high by 321 inches wide. (406 sq. ft.)</p>', '<p>兩張雙人床（可改成大床）、兩張開放式床架、起居間帶雙人沙發床、私人浴室（帶淋浴）和洗臉盆。設有高76&rdquo;x 闊321&rdquo; 的環迴落地觀景窗。 (406平方尺)&nbsp;</p>', 4, 'upload/image/Panoramic Ocean View P1 P2.jpg', 1436945285, 1436948459),
('Ship_VY', 21, 'PR', 'Promenade Stateroom', '皇家大道家庭景觀房', '<p>Bowed windows with a view of the Royal Promenade, two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, sitting area with sofa, vanity area and a private bathroom. (160 sq. ft.)</p>', '<p>弓型窗，可俯瞰皇家大道，兩張雙人床（可改成大床）、起間居（帶沙發床）、私人浴室和洗臉盆。 (160平方尺)</p>', 2, 'upload/image/Promenade PR.jpg', 1436945710, 1439350682),
('Ship_VY', 22, 'RS', 'Royal Suite', '皇家陽台套房', '<p>Separate bedroom with king-size bed, private balcony with hot tub, whirlpool bathtub, living room with queen-size sofa bed, baby grand piano, and concierge service. <br />(1,087 sq. ft., balcony 217 sq. ft.)</p>', '<p>獨立的臥室、大床、私人陽台帶浴缸、按摩浴缸，起居室帶大沙發床，小三角鋼琴，禮賓服務。 <br />（1,087平方尺，陽台217平方尺）</p>', 4, 'upload/image/Royal Suite.jpg', 1436782389, 1436948398),
('Ship_MA', 23, 'E2/E3', 'Deluxe Ocean View Stateroom with Balcony', '標準陽台房 ', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, private balcony, sitting area with sofa, and a private bathroom. Rates vary from deck to deck.<br />(184 sq. ft., balcony 50 sq. ft.)<br /><br /></p>', '<p>兩張雙人床（可改成大床）、私人陽台、起居間（有些帶沙發床）、私人浴室。各層甲板的房費不同。 (184平方尺、陽台50平方尺)</p>', 2, 'upload/image/-阳台房_resize.jpg', 1444808646, 1444897572),
('Ship_MA', 26, 'I', 'Oceanview Stateroom', '海景房 ', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, sitting area with sofa, vanity area, and a private bathroom. <br />(160 sq. ft.)</p>', '<p>兩張雙人床（可改成大床）、起居間（有些帶沙發床）、私人浴室和洗臉盆。 （160平方尺）</p>', 2, 'upload/image/-海景房_resize-642.jpg', 1444898558, 0),
