('Ship_QN', 30, 'OS', 'Owner Suite', '主人套房', '<p>Bedroom area with two twin beds that convert to Royal King, measuring 72.5 inches wide by 82 inches long. Full bathroom with tub and two sinks. Separate half bath. Marble entry, large closets, living area with dining table and sofa that converts to double bed. Wrap around private balcony with seating area and private outdoor dining. Sleeps up to 4. <br />(541 sq. ft., balcony 259 sq. ft.)</p>', '<p>兩張單人床，可改成大床, 大床約72.5" x 82" 。私人浴室（帶浴缸）、單獨的淋浴和兩個洗滌盤。房間設有衣櫥、起居室設有餐檯及沙發可轉換至雙人睡床。私人陽台設有廣闊地方以供用膳。</p>\r\n<p>（541平方尺，陽台259平方尺）</p>', 2, 'upload/image/RCI_QN-OwnerSuiteF.jpg', 1446696130, 1446696155),
('Ship_QN', 31, 'GS', 'Grand Suite', '豪華套房', '<p>Bedroom area with two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, and separate dressing area with entrance to bathroom. Full bathroom with tub, two sinks and second entrance that opens to living room. Living room with sofa that converts to double bed, entertainment center, and writing desk. Private balcony with seating area and private dining. Sleeps up to 4. <br />(351 sq. ft., balcony 109 sq. ft.)</p>', '<p>兩張單人床，可改成大床, 大床約72.5" x 82" 。更衣室分隔，均可通往浴室，全配套浴室設有浴缸及兩個洗滌盤。起居室設有娛樂活動空間，書桌及沙發可轉換至雙人睡床。私人陽台設有廣闊地方以供用膳。</p>\r\n<p>（351平方尺，陽台109平方尺）</p>', 2, 'upload/image/RCI_QN-GrandSuiteF.jpg', 1446696643, 0),
('Ship_QN', 32, 'JS', 'Junior Suite', '標準套房', '<p>Bedroom area with two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long. Full bathroom with tub. Sitting area with sofa that converts to double bed. Large corner private balcony. Semi-private vestibule can be used to connect adjacent Studio Interior Stateroom and Ocean View Balcony Stateroom. Sleeps up to 4.<br />(276 sq. ft., balcony 161 sq. ft.)</p>', '<p>兩張單人床，可改成大床, 大床約72.5" x 82" 。全配套浴室設有浴缸。起居室設有沙發可轉換至雙人睡床。半私人門外大廳可跟單人內艙房及陽台房連通。</p>\r\n<p>(276平方尺、陽台161平方尺)</p>', 2, 'upload/image/RCI_QN-FamJuniorSuiteF.jpg', 1446696715, 0),
